pragma solidity ^0.4.23;

import 'zeppelin-solidity/contracts/ownership/Ownable.sol';

contract ExchangeRates is Ownable {
    struct RateFactor {
        uint256 factor1;
        uint256 factor2;
    }

    event SetRate(
        string ccy1,
        uint256 rateFactor1,
        string ccy2,
        uint256 rateFactor2
    );

    /**
     * Map that stores exchange rates in the following form:
     *  ccy1 => ccy2 => (factor1, factor2)
     * The conversion formula is: v1*factor1 = v2*factor2
     */
    mapping(string => mapping(string => RateFactor)) rates;
    mapping(string => mapping(string => bool)) existingRates;

    constructor() public{

    }

    function setRate(string _ccy1, uint256 _rateFactor1, string _ccy2, uint256 _rateFactor2) public onlyOwner returns (bool){
        require(_rateFactor1 !=0 && _rateFactor2 != 0);
        RateFactor memory rf = RateFactor({
            factor1 : _rateFactor1,
            factor2 : _rateFactor2
            });
        rates[_ccy1][_ccy2] = rf;
        existingRates[_ccy1][_ccy2] = true;
        emit SetRate(_ccy1, _rateFactor1, _ccy2, _rateFactor2);
        return true;
    }

    function getRate(string _ccy1, string _ccy2) public view returns (uint256 rateFactor1, uint256 rateFactor2){
        if (existingRates[_ccy1][_ccy2]) {
            RateFactor memory rf1 = rates[_ccy1][_ccy2];
            return (rf1.factor1, rf1.factor2);
        } else if (existingRates[_ccy2][_ccy1]) {
            RateFactor memory rf2 = rates[_ccy2][_ccy1];
            return (rf2.factor2, rf2.factor1);
        } else {
            return (0, 0);
        }
    }
}
